import { FormTypes } from "../../stores";
var selectedDep = {
    id: 45123
};
var form = "";
var departments = [
    {
        name: "The Man Department",
        id: 45123,
    },
    {
        name: "The Woman Department",
        id: 12345
    }
];
var handleChanged = function (id) {
    if (departments.find(function (_dep) { return _dep.id === id; })) {
        selectedDep = id;
    }
};
var options = [
    {
        key: 45123,
        text: "45123 - The Man Department"
    },
    {
        key: 12345,
        text: "12345 - The Woman Department"
    }
];
function dropdownInfo() {
    var info = {
        title: "",
        key: selectedDep ? selectedDep.id : 0,
        placeHolder: "Departments",
    };
    info.title = selectedDep ? "Your Department:" : "Select a Department";
    return info;
}
var boxForm = function () { return (form = FormTypes.NEW_BOX); };
export var ddP = {
    handleChanged: handleChanged,
    options: options,
    dropdownInfo: dropdownInfo,
    initializeBoxForm: boxForm
};
export default ddP;
